import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Project_list = ({ user }) => { // Destructure user from props
    const [projects, setProjects] = useState([]);

    useEffect(() => {
        const fetchProjects = async () => {
            try {
                const response = await axios.get(`http://localhost:8000/djapp/projects/?user=${user.email}`, {
                    headers: {
                        Authorization: `Bearer ${localStorage.getItem('access')}`
                    }
                });
                setProjects(response.data);
            } catch (error) {
                console.error('Error fetching projects:', error);
            }
        };

        fetchProjects();
    }, [user]); // Trigger effect when user changes

    return (
        <div>
            <h1>Project List</h1>
            <ul>
                {projects.map(project => (
                    <li key={project.projectid}>
                        <strong>Project ID:</strong> {project.projectid}<br />
                        <strong>Project Name:</strong> {project.projectname}<br />
                        {/* Add other project details as needed */}
                    </li>
                ))}
            </ul>
        </div>
    );
};

const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated,
    user: state.auth.user,
    project: state.auth.project
});

export default connect(mapStateToProps, { createProject })(Project);
